class App extends React.Component {
  constructor() {
    super();
    this.state = {
      count: 0,
      Values: [],
      textvalue: "",
    };
    //this.Values = [];
    //this.textvalue = "text";
    this.Addvalue = this.Addvalue.bind(this);
    //const [textvalues, setState] = useState("");
  }

  increase(prop) {
    let floors = [...this.state.Values];

    // Add item to it
    floors.push({ prop });

    // Set state
    this.setState({ floors });
    //this.setState({ Values: Values.push(prop) });
  }
  Item = (props) => {
    const { sx, ...other } = props;
    return (
      <Box
        sx={{
          bgcolor: (theme) =>
            theme.palette.mode === "dark" ? "#101010" : "#fff",
          color: (theme) =>
            theme.palette.mode === "dark" ? "grey.300" : "grey.800",
          border: "1px solid",
          borderColor: (theme) =>
            theme.palette.mode === "dark" ? "grey.800" : "grey.300",
          p: 1,
          m: 1,
          borderRadius: 2,
          fontSize: "0.875rem",
          fontWeight: "700",
          ...sx,
        }}
        {...other}
      />
    );
  };

  Addvalue(evt) {
    //console.log(this.state.textvalue);
    evt.preventDefault();

    let tasks = this.state.Values;
    let textvalue = this.state.textvalue;
    tasks.push(textvalue);
    this.setState({ textvalue: "" });
    this.setState({ Values: tasks });
    //console.log(this.state.Values);
  }
  updateInput = (evt) => {
    this.setState({ textvalue: evt.target.value });
  };
  handleKeypress = (e) => {
    //it triggers by pressing the enter key
    console.log(e);
    if (e.charCode === 13 && this.state.textvalue) {
      this.Addvalue(e);
    }
  };
  render() {
    console.log(this.state.Values);
    let vals = this.state.Values;
    console.log(typeof vals);
    return (
      <div style={{ margin: "50px" }}>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <TextField
              id="standard-basic"
              label="Standard"
              variant="standard"
              value={this.state.textvalue}
              onChange={this.updateInput}
              onKeyPress={this.handleKeypress}
              sx={{
                width: "80%",
              }}
            />

            <Button
              variant="contained"
              sx={{
                width: "92px !important",
              }}
              startIcon={<AddCircle />}
              onClick={this.Addvalue}
            >
              Add
            </Button>
          </Box>
        </Stack>
        <Stack direction="row" justifyContent="center">
          <Box
            component="div"
            sx={{
              "& > :not(style)": {
                m: 1,
                width: "50ch",
              },
              mx: "2px",
              transform: "scale(0.8)",
              display: "contents",
            }}
            noValidate
            autoComplete="off"
          >
            <Box sx={{ display: "grid", gridTemplateRows: "repeat(3, 1fr)" }}>
              {this.state.Values.length !== 0 ? (
                vals.map((Va) => <this.Item>{Va}</this.Item>)
              ) : (
                <this.Item>No information</this.Item>
              )}
            </Box>
            {/* <List
              sx={{
                width: "100%",
                maxWidth: "100%",
                bgcolor: "background.paper",
                position: "relative",
                overflow: "auto",
                maxHeight: 300,
                backgroundColor: "gray",

                "& ul": { padding: 0 },
              }}
              subheader={<li />}
            >
              {this.state.Values.length !== 0 ? (
                vals.map((Va) => (
                  <li
                    key={`section-${Va}`}
                    sx={{
                      "& > :not(style)": {
                        m: 1,
                        width: "50ch",
                      },
                      marginBottom: "10px",
                    }}
                  >
                    <ul>
                      <Card
                        sx={{
                          minWidth: 275,
                          marginTop: "5px",
                          marginBottom: "5px",
                        }}
                      >
                        <CardContent>
                          <Typography
                            sx={{ fontSize: 14 }}
                            color="text.secondary"
                            gutterBottom
                          >
                            {` ${Va}`}
